import Contact from "./pages/Contact";

// import Footer from "./components//Footer";

function App() {
  return (
    <Router>
      <div>
        <div className="Navbar">
          <Header />
          <Routes>
            <Route exact path="/" component={App} />
            <Route path="/contact" component={Contact} />
          </Routes>
        </div>
        <div>
          <Hero></Hero>
        </div>
        {/* <div className="homepage">
        <Footer></Footer>
      </div> */}
      </div>
    </Router>
  );
}

export default App;
